import React, { useEffect } from "react";
import ListItem from "../components/ListItem";

function List({ list }) {
  const stuff = {
    name: "Blackbird",
    id: 1,
    created_at: "2021-05-19",
    items: [
      {
        name: "Buy milk",
        id: 1,
        importance: 1
      },
      {
        name: "Buy eggs",
        id: 2,
        importance: 2
      },
      {
        name: "Buy bread",
        id: 3,
        importance: 3
      }
    ]
  };

  useEffect(() => {
    console.log(list);
  }, [list]);

  return (
    <div className="page-background center-stuffs">
      <h1>{stuff.name}</h1>
      <p>{stuff.created_at}</p>
      <ul>
        {stuff.items.map(item => (
          <ListItem key={item.id} item={item} />
        ))}
      </ul>
    </div>
  );
}

export default List;
